#define MAP(a) a&0xFFFFFF
#define MAPT(a) (a>>32)&0xFFFFFF



hashItem table[1024*1024*16];
bool tableset[1024*1024*16];
void BoardHash::cleartable()
{
    memset(table,0,sizeof(table));
    memset(tableset,0,sizeof(tableset));
}
bool BoardHash::search(int& score,int d,int alpha,int beta)
{

    total_search++;
    hashItem *h=&table[MAP(key)];

    if(h->checksum==check_key&&h->depth>=d&&h->depth<=MAX_SEARCH_DEPTH)
    {
        if(h->type==EXACT||(h->type==UPPER&&h->score<=alpha)||(h->type==LOWER&&h->score>=beta))
        {
            score=h->score;
            hit_search++;
            return true;
        }
    }
    return false;
}


void BoardHash::entry(int score,int d,char type)
{

    if(tableset[MAP(key)])
        crash_count++;
    else
        tableset[MAP(key)]=true;

    hashItem *h=&table[MAP(key)];

    h->checksum=check_key;
    h->depth=d;
    h->score=score;
    h->type=type;
    entry_count++;

}














